import React from 'react';
import { slide as Menu } from 'react-burger-menu'

class Nav extends React.Component {
  showSettings (event) {
    event.preventDefault();
  }

  render () {
    return (
      <Menu right pageWrapId={ "page-wrap" } outerContainerId={ "outer-container" }>
        <a id="aboutNav" className="menu-item" href="/">About Me</a>
        <a id="experiencesNav" className="menu-item" href="/about">Experiences</a>
        <a id="skillsNav" className="menu-item" href="/contact">Skills</a>
        <a id="contactNav" className="menu-item" href="/contact">Contact</a>
      </Menu>
    );
  }
}

export default Nav;
